window.bookSummaryJSON = "<p>Of all the things that could have landed in her yard, it had to be him.<br> <br> For most people, finding a half-naked superbeing in their yard might be a dream come true.<br> <br> Unfortunately for Gracie Castro, it’s the exact opposite.<br> <br> Especially when he’s grouchy, rude, and shows no signs of leaving anytime soon. <br> <br> But when a hero of mankind needs you, you do what you have to.<br> <br> Even if it compromises everything you know.<br> <br> And totally changes your life.</p>"; 
